/*users.jsx*/
import React from "react";
import ScheduleEngine from "./ScheduleEngine";
import styled from "@emotion/styled";

const HomeDiv = styled.div`
  display: flex;
  flex-direction: row;
  margin-left: 20px;
  margin-top: 10px;
  text-align: center;
`;

const TopFormat = styled.div`
  margin: 0 auto;
  width: 100%;
  overflow: auto;
  display: inline-block;
  background: white;
  border-radius: 25px;
`;

const LogoCard = styled.img`
  width: 450px;
  height: 100px;
  justify-content: space-around;
  float: left;
  // text-align: center;
  // resizemode: "contain";
  // left: 50%;
  // transform: translate(-50%, -50%);
`;

const HomePage = () => {
  return (
    <div style={{ padding: "1rem" }}>
      <TopFormat>
        <LogoCard
          id="logo"
          src="./img/meetingGroundLogo.png"
          alt="Meeting Ground Logo"
        />

        <h1
          style={{
            position: "relative",
            width: 200,
            margin: 0,
            float: "left",
            left: "15%",
            top: 20,
          }}
        >
          Main Page
        </h1>

        <button
          className="btn btn-primary"
          id="authorize_button"
          onClick={handleAuthClick}
          style={{
            height: "30%",
            justifyContent: "center",
            alignSelf: "center",
            display: authorizeButton,
            float: "right",
            margin: 30,
          }}
        >
          Sign in
        </button>
        <button
          className="btn btn-danger"
          id="signout_button"
          onClick={handleSignoutClick}
          style={{
            height: "30%",
            justifyContent: "center",
            alignContent: "center",
            display: signoutButton,
            float: "right",
            margin: 30,
          }}
        >
          Sign Out
        </button>
      </TopFormat>

      <HomeDiv>
        <ScheduleEngine timeLength={15} />
        <ScheduleEngine timeLength={30} />
        <ScheduleEngine timeLength={50} />
      </HomeDiv>
    </div>
  );
};

export default HomePage;
